  const [pageTitle, setPageTitle] = React.useState<string>("Test");

  const handlePageTitle = React.useCallback((newTitle: string) =>{
      setPageTitle(newTitle)
  },[])

  return(
    <PageLayout title={pageTitle}>
      <Routes>
        <Route path="/" element={<div>Page-1</div>}/>
        <Route path="/1" element={<div>Page-2</div>}/>
      </Routes>
    </PageLayout>
  )
}

export default App;
